templates = {"embedded_img":{"head":"            <style type='text/css'>\n              body {\n  background-image: url(data:image/png; charset=binary\n;base64,); }\n\n            </style>\n            <script type='text/javascript'>\n              \n            </script>\n","body":"<h1>Embedded image test</h1>\n<img src='data:image/png; charset=binary\n;base64,' />\n"},"temp1":{"head":"            <style type='text/css'>\n              body {\n  margin: 0px;\n  -webkit-box-sizing: border-box;\n  background: #99ccaa;\n  padding: 2em;\n  height: 100%;\n  margin: 0px; }\n  body h1 {\n    color: black; }\n  body h2 {\n    color: rgba(0, 0, 0, 0.4); }\n  body .columns {\n    -webkit-column-width: 15em;\n    -webkit-column-gap: 2em;\n    -webkit-column-rule: 1px dashed rgba(0, 0, 0, 0.2);\n    color: rgba(0, 0, 0, 0.75); }\n  body .credit {\n    float: right;\n    color: rgba(0, 0, 0, 0.4); }\n\n            </style>\n            <script type='text/javascript'>\n              \n            </script>\n","body":"<div id='template'>\n  <h1>The Elder Scrolls: Daggerfall</h1>\n  <h2>The second installment of the classic RPG series</h2>\n  <div class='columns'>\n    <p>In Daggerfall, as in all The Elder Scrolls games, players are not required to follow questlines or fill specific character archetypes.</p>\n    <p>Daggerfall features a spell-creation system where, through the Mages Guild, players can create custom spells with several different effects. The game will then automatically generate the mana cost of the spell based on the power of the effects chosen.</p>\n    <p>Other features include an equipment enchantment system (similar in concept to the spell creation system); the ability to buy houses and ships; a variety of clothing and equipment; dynamic political relationships between kingdoms; the ability to become a vampire, werewolf, or wereboar; and the combat system, which uses mouse movement to determine the direction and effect of weapon swings in melee combat.</p>\n    <p>The political system is supported by a net of guilds, orders, and religions, all with unique tasks and quests. Joining and contributing to these organizations allow the player to raise ranks and gain a reputation in the game world, which affects how NPCs and other factions view the player.</p>\n    <p>Daggerfall has genre-typical gore elements and some sexual topics. It displays cartoonish nudity (showing breasts but no genitals) both on NPCs and on the character's paper doll when all equipment is removed. The game installer includes a password-protected childgard feature that hides blood and corpses (instead showing just the skeleton of the corpse), disables sexual topics (though not removing all nudity), and ensures the character portrait is wearing underwear at all times.</p>\n    <h3>The Game World</h3>\n    <p>Daggerfall, like the other games in the Elder Scrolls series, takes place on the fictional continent of Tamriel. In Daggerfall, the player may travel within the High Rock and Hammerfell provinces of Tamriel. A wide range of formidable enemies, the strongest of which are the Daedra, make the journey through these realms difficult.</p>\n    <p>Bethesda claims that the scale of the game is equal to twice the size of Great Britain:[1] around 487,000 square kilometers. The game world features over 15,000 towns, cities, villages, and dungeons for the player's character to explore. According to Todd Howard, an Elder Scrolls programmer, the game's sequel, The Elder Scrolls III: Morrowind, is 0.01% the size of Daggerfall, but it should be noted most of Daggerfall's terrain was randomly generated. Vvardenfell, the explorable part of Morrowind in the third game has 10 square miles (25.9 square kilometers).[2][3] The Elder Scrolls IV: Oblivion has approximately 16 square miles (41.4 square kilometers) to explore.[4] In Daggerfall, there are 750,000+ non-player characters (NPCs) for the player to interact with, compared to the count of around 1,000 NPCs found in Morrowind and Oblivion. However, the geography and the characters in these later games are much more detailed.</p>\n    <p>An automap was implemented to help players navigate through the lengthy tombs and ancient underground fortresses. Players have to visit approximately 6-8 areas in order to finish the game, although a total of 47 areas are present. A limited array of building blocks were used to construct the towns and dungeons, causing some reviewers to complain about the game's monotony. In 2002, Morrowind, the third game in the series, responded to this issue with a smaller, more detailed world containing unique-looking cities and NPCs with greater individuality.</p>\n  </div>\n  <div class='credit'>All content gathered from Wikipedia.</div>\n</div>\n"},"temp2":{"head":"            <style type='text/css'>\n              #template {\n  -webkit-box-sizing: border-box;\n  height: 100%;\n  width: 100%;\n  background: white;\n  padding: 2em; }\n  #template h1 {\n    letter-spacing: 0.06em; }\n  #template .columns {\n    -webkit-column-width: 15em;\n    margin: 0px;\n    width: 900px;\n    text-align: justify; }\n  #template ul {\n    list-style: none;\n    margin: 0px;\n    padding: 0px;\n    border-top: 3px solid black;\n    width: 900px; }\n    #template ul li {\n      float: left;\n      border-left: 1px dashed rgba(0, 0, 0, 0.2);\n      background: #f3f3f3;\n      padding: 1em;\n      margin: 0px;\n      width: 300px;\n      height: 200px;\n      -webkit-box-sizing: border-box; }\n      #template ul li:first-child {\n        border-left: none; }\n      #template ul li h3 {\n        color: rgba(0, 0, 0, 0.4); }\n\n            </style>\n            <script type='text/javascript'>\n              $(\"h1\").css({\n  color: \"red\"\n});\n            </script>\n","body":"<div id='template'>\n  <h1>The Elder Scrolls: Daggerfall</h1>\n  <h2>The second installment of the classic RPG series</h2>\n  <div class='columns'>\n    <p>In Daggerfall, as in all The Elder Scrolls games, players are not required to follow questlines or fill specific character archetypes.</p>\n    <p>Daggerfall features a spell-creation system where, through the Mages Guild, players can create custom spells with several different effects. The game will then automatically generate the mana cost of the spell based on the power of the effects chosen.</p>\n    <p>Other features include an equipment enchantment system (similar in concept to the spell creation system); the ability to buy houses and ships; a variety of clothing and equipment; dynamic political relationships between kingdoms; the ability to become a vampire, werewolf, or wereboar; and the combat system, which uses mouse movement to determine the direction and effect of weapon swings in melee combat.</p>\n    <p>The political system is supported by a net of guilds, orders, and religions, all with unique tasks and quests. Joining and contributing to these organizations allow the player to raise ranks and gain a reputation in the game world, which affects how NPCs and other factions view the player.</p>\n    <p>Daggerfall has genre-typical gore elements and some sexual topics. It displays cartoonish nudity (showing breasts but no genitals) both on NPCs and on the character's paper doll when all equipment is removed. The game installer includes a password-protected childgard feature that hides blood and corpses (instead showing just the skeleton of the corpse), disables sexual topics (though not removing all nudity), and ensures the character portrait is wearing underwear at all times.</p>\n    <h3>The Game World</h3>\n    <p>Daggerfall, like the other games in the Elder Scrolls series, takes place on the fictional continent of Tamriel. In Daggerfall, the player may travel within the High Rock and Hammerfell provinces of Tamriel. A wide range of formidable enemies, the strongest of which are the Daedra, make the journey through these realms difficult.</p>\n    <p>Bethesda claims that the scale of the game is equal to twice the size of Great Britain:[1] around 487,000 square kilometers. The game world features over 15,000 towns, cities, villages, and dungeons for the player's character to explore. According to Todd Howard, an Elder Scrolls programmer, the game's sequel, The Elder Scrolls III: Morrowind, is 0.01% the size of Daggerfall, but it should be noted most of Daggerfall's terrain was randomly generated. Vvardenfell, the explorable part of Morrowind in the third game has 10 square miles (25.9 square kilometers).[2][3] The Elder Scrolls IV: Oblivion has approximately 16 square miles (41.4 square kilometers) to explore.[4] In Daggerfall, there are 750,000+ non-player characters (NPCs) for the player to interact with, compared to the count of around 1,000 NPCs found in Morrowind and Oblivion. However, the geography and the characters in these later games are much more detailed.</p>\n    <p>An automap was implemented to help players navigate through the lengthy tombs and ancient underground fortresses. Players have to visit approximately 6-8 areas in order to finish the game, although a total of 47 areas are present. A limited array of building blocks were used to construct the towns and dungeons, causing some reviewers to complain about the game's monotony. In 2002, Morrowind, the third game in the series, responded to this issue with a smaller, more detailed world containing unique-looking cities and NPCs with greater individuality.</p>\n  </div>\n  <ul>\n    <li>\n      <h3>acts_as_buffoon</h3>\n      <p>\n        If you enjoy Typekit In Situ then stop by my blog at\n        <a href='http://actsasbuffoon.com'>http://actsasbuffoon.com</a>\n        and say hello. It's always nice to get feedback.\n      </p>\n    </li>\n    <li>\n      <h3>Ever Get That Feeling...</h3>\n      <p>Have you ever felt like you only exist to serve as an example to others?</p>\n    </li>\n    <li>\n      <h3>My Keys</h3>\n      <p>I can't find my keys. Has anyone seen my keys? I've looked though the living room, the kitchen, the bathroom, and the garage.</p>\n    </li>\n  </ul>\n</div>\n"}};
